  `headimgurl` char(200) CHARACTER SET utf8 DEFAULT NULL,
  `language` char(10) CHARACTER SET utf8 DEFAULT NULL,
  `Robot` tinyint(1) DEFAULT '0',
  `ChannelType` char(30) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=3013 DEFAULT CHARSET=utf8mb4;

