/* Procedure structure for procedure `AddGold` */

/*!50003 DROP PROCEDURE IF EXISTS  `AddGold` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `AddGold`(userIdx INT (11),goldx Int (11),change_typex int(2))
BEGIN
	DECLARE scorex INT DEFAULT -1;
	SELECT score INTO scorex FROM newuseraccounts WHERE Id = useridx;
	IF scorex = -1 THEN
		SELECT 0 AS rcode;
	ELSE
		UPDATE newuseraccounts SET score=score+goldx WHERE Id = userIdx;
		INSERT INTO score_changelog(userid,score_before,score_change,score_current,change_type,isOnline) VALUES(userIdx,scorex,goldx,scorex + goldx,change_typex,0);
		SELECT 1 AS rcode;
	END IF;
   END */$$
DELIMITER ;

/* Procedure structure for procedure `addPrize` */

/*!50003 DROP PROCEDURE IF EXISTS  `addPrize` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `addPrize`(roomTypex INT(3),matchIdx int(20))
BEGIN
	SELECT gameaccount.msg.*,fish.`matchrandking`.`rankIdx` FROM gameaccount.msg LEFT JOIN fish.`matchrandking` ON msg.`matchlogId` = fish.`matchrandking`.`id` WHERE fish.matchrandking.roomType=roomTypex AND fish.matchrandking.matchId=matchIdx AND msg.isGetPrize=0;
END */$$
DELIMITER ;

/* Procedure structure for procedure `checkPhone` */

/*!50003 DROP PROCEDURE IF EXISTS  `checkPhone` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `checkPhone`(idx INT(11),phoneNox VARCHAR(11))
BEGIN
	SET @flag = 0;
	SET @phone = "";
	SELECT COUNT(*) INTO @flag FROM newuseraccounts WHERE phoneNo = phoneNox;
	select phoneNo INTO @phone FROM newuseraccounts WHERE Id = idx;
	if @flag = 1 or @phone != "" then
		select 0 as rcode;
	else
		select 1 AS rcode;
	end if;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `copyhand` */

/*!50003 DROP PROCEDURE IF EXISTS  `copyhand` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `copyhand`()
BEGIN
	DECLARE i INT DEFAULT 0;
	DECLARE randidx INT DEFAULT 0;
	select COUNT(*) INTO @recordcount from newuseraccounts where robot = 1;
	select COUNT(*) INTO @randMax from newuseraccounts where ADDDATE > '2016-12-29';
	while i < @recordcount do
		select FLOOR(RAND()* 10) into randidx;
		select headimgurl into @url from newuseraccounts where AddDate > '2016-12-29' LIMIT randidx,1;
		-- update newuseraccounts SET headimgurl = @url where robot = 1 LIMIT i,1;
		select Id into @idx from newuseraccounts where robot = 1 LIMIT i,1;
		update newuseraccounts SET headimgurl = @url where Id = @idx;
		set i = i + 1;
	end WHILE;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `createRecharge` */

/*!50003 DROP PROCEDURE IF EXISTS  `createRecharge` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `createRecharge`(openidx VARCHAR(50),total_feex float(10),out_trade_nox VARCHAR(30),goodsIdx INT(2))
BEGIN
	SET @recordcount = (SELECT COUNT(*) FROM recharge WHERE out_trade_no = out_trade_nox);
	IF @recordcount <= 0 THEN
		INSERT INTO recharge(Account,total_fee,out_trade_no,goodsid) VALUES(openidx,total_feex,out_trade_nox,goodsIdx);
